ove the trees bro\nI’ve man in the corner landing jets I call him heathrow\nDripping since a youngin i been eating since a teen bro\n\nI, I know most people gonna say what they wanna say\nMost people gonna smoke what they wanna smoke\nAnd others, they don’t care about no other things\nAnd sometimes, it’s hard to tell exactly where I wanna go\nI know it don’t show X2\n\nAnd I can’t even lift my hands up, \nthat’s what we dance for lawd, I’m going in\nAnd right when I get all my hopes up, something explodes lord\nI never win\n\nYou can’t touch me, I been buried alive by the devil that’s in them hills\nYou can’t help me, I know it’s wrong but the devil, is in them hills\nNo chance\n\nAnd you tell me, that it’s all a lie I know\nIs he holy? all i know is that he’s going to find me.","commandRuns":[{"startIndex":85,"length":29,"onTap":{"innertubeCommand":{"clickTrackingParams":"CLgBEM2rARgBIhMI3rW7h-G2hgMVs7JjBh0hogmVSMe32863vKarEA==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbTVCN0NoRkdPM2hEa1djLTNIendfVkNVTGc5UXxBQ3Jtc0tudkxsUzZwbERWQzlJYmRLWmR1NFNiRktXNmxJMlhKR2tDUzdQYThmYkVHc3JWWTgyWlFsa1FMa1BTZng5LVFmNF8yelRwd295OFNaLUFlbG50YUR0YU8wSEotRVAwa2cwdVduemZSc2JCV2pHMm1YSQ\u0026q=https%3A%2F%2Fbit.ly%2FBarteesStrange\u0026v=EFaZ43nW28c","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbTVCN0NoRkdPM2hEa1djLTNIendfVkNVTGc5UXxBQ3Jtc0tudkxsUzZwbERWQzlJYmRLWmR1NFNiRktXNmxJMlhKR2tDUzdQYThmYkVHc3JWWTgyWlFsa1FMa1BTZng5LVFmNF8yelRwd295OFNaLUFlbG50YUR0YU8wSEotRVAwa2cwdVduemZSc2JCV2pHMm1YSQ\u0026q=https%3A%2F%2Fbit.ly%2FBarteesStrange\u0026v=EFaZ43nW28c","target":"TARGET_NEW_WINDOW","nofollow":true}}}},{"startIndex":150,"length":21,"onTap":{"innertubeCommand":{"clickTrackingParams":"CLgBEM2rARgBIhMI3rW7h-G2hgMVs7JjBh0hogmVSMe32863vKarEA==","commandMetadata":{"webCommandMetadata":{"url":"ht
